import React from "react";
import { Card } from "./card";
import './top-card-list.css';

const cardListData = [
    {
        username: '@Diegofergamboa',
        id: 1 ,
        followers: 1453 ,
    },
    {
        username: '@PepitoPerez',
        id: 2 ,
        followers: 1453 ,
    },
    {
        username: '@DiegoOrtiz',
        id: 3 ,
        followers: 1453 ,
    },
    {
        username: '@JavaScriptRamirez',
        id: 4 ,
        followers: 1453 ,
    },
    {
        username: '@OtroUser',
        id: 5 ,
        followers: 1453 ,
    },
];






function TopCardList() {
    return (
        <section className="top-cards">
        <div className="wrapper">
            <div className="grid">
                {
                    cardListData.map(({username, id}) => (<Card key='username.id' username={username}/>))
                }
            </div>
    </div>
    </section>
    );
};

export { TopCardList } ;
